import React, { Component } from 'react';

class Account extends Component {
    render() {
      return (
        <>
        <Piggy/>
        <Text/>
        <Text2/>
        <InputEmail/>
        <InputPass/>
        <Login/>
        <Create/>
        <Terms/>
        </>
      );
    }
  }
  
  export default Account;
